import React from 'react';
import {
    Route,
    Switch, 
    BrowserRouter,
    useHistory
} from 'react-router-dom';


import ASide from '../Aside/Aside';
import Sidebar from '../Sidebar/Sidebar';
import Employe from '../../pages/Employe/Employe';
import Conge from '../../pages/Conge/Conge'

const Content = ({rest}) => {
    return(
        <BrowserRouter>
            
            <div className="container">
             { console.log(rest) }
                <Sidebar />
                <Switch>
                    <Route rest path="/employe" component={Employe} />
                    <Route path="/conges" component={Conge} />
                </Switch>
                <ASide />
            </div>
        </BrowserRouter>
    )
}

export default Content;
